@datapythonista 
> Moved to pip, let's see if tests pass. For @h-vetinari comment I understood that even pip version would make the tests fail.

FYI, the tests I was talking about got skipped because `s3fs` was not installed. That's fine if you just want `moto` without the `boto` tests. If you *do* want the `boto` tests, you'll need to add `s3fs` to the conda environment (and *then* you'll run into #23754 for `pandas/tests/io/json/test_compression.py::test_with_s3_url` and `pandas/tests/io/test_excel.py::TestXlrdReader::test_read_from_s3_url`; the other `s3` tests would be silently skipped in the `except: pytest.skip` clause of the `s3_resource` fixture)
